import axiosServices from "./axiosServices";
import {API_ENDPOINT} from "../../Common/constants/index";

export const myVoucher=(makhachhang)=>{
    return axiosServices.get(`${API_ENDPOINT}/khuyenmaicuatoi?makhachhang=${makhachhang}`);
}
